import me from './dustin.png';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
	<div>
	        <img src={me} className="self-picture" alt="self" />
	</div>

	<div class="text-container">
		<div class="name-container">
			Dustin O'Brien
		</div>
		  {/*<div class="cs-container">Computer Science Major</div>*/}
		{/*<div class="ds-container">Data Science Major</div>*/}
	</div>
      </header>
    </div>
  );
}

export default App;
